export class MapIcons {
    static getIconName(poi: any, poiLevel: number, withExtension: boolean) {

        let iconName = "level" + poiLevel;

        if (poi.UsageType != null && poi.UsageType.Title.indexOf("Private") > -1) {
            iconName += "_private";
        } else if (poi.StatusType != null && poi.StatusType.IsOperational != true) {
            iconName += "_nonoperational";
        } else {
            iconName += "_operational";
        }

        if (withExtension) {
            iconName += "_icon.png";
        }

        return iconName;
    }

    static getIcon(name): string {
        switch (name) {
            case "level0_nonoperational": return "data:image/png;base64,";
            case "level0_operational": return "data:image/png;base64,";
            case "level0_private": return "data:image/png;base64,";
            case "level1_nonoperational": return "data:image/png;base64,";
            case "level1_operational": return "data:image/png;base64,";
            case "level1_private": return "data:image/png;base64,";
            case "level2_operational": return "data:image/png;base64,";
            case "level2_nonoperational": return "data:image/png;base64,";
            case "level2_private": return "data:image/png;base64,";
            case "level3_nonoperational": return "data:image/png;base64,";
            case "level3_operational": return "data:image/png;base64,";
            case "level3_private": return "data:image/png;base64,";
            case "level4_nonoperational": return "data:image/png;base64,";
            case "level4_operational": return "data:image/png;base64,";
            case "level4_private": return "data:image/png;base64,";

            default: return "data:image/png;base64,";
        }
    }
}
